import React from 'react'
import {list, ListItem, ListItemAvatar, Avatar, ListItemText} from '@material-ui/core';
// import './Todo.css';

function Todo(props) {
    return (
        <list>
            <ListItem> 
                <ListItemAvatar>
                </ListItemAvatar>
                    <ListItemText primary={props.todo} secondary="Dummy deadline">
                    </ListItemText>
            </ListItem>
        </list>
    )
}

export default Todo
